function hello(){
    var synth=window.speechSynthesis;
    speak_data="HELLO";
    var utterThis=new SpeechSynthesisUtterance(speak_data);
    synth.speak(utterThis);
    document.getElementById("resulthello").innerHTML='<img id="hello" src="data:image/png;base64,">';
}
